import React from 'react';
import aboutData from '../DataFiles/AboutData.js';

function About() {
  return (
    <div>
      {aboutData.map((section, index) => (
        <div key={index}>
          <h2>{section.title}</h2>
          <p>{section.description}</p>
          {section.collaboration && (
            <p><b>Collaboration: </b>{section.collaboration}</p>
          )}
          {section.innovation && (
            <p>{section.innovation}</p>
          )}
          {section.inclusivity && (
            <p>{section.inclusivity}</p>
          )}
        </div>
      ))}
    </div>
  );
}

export default About;
